NQP_ManualActions_1.query:
q = load "${App.Datasets.LoyaltyLedger66.FullyQualifiedName}";
q = filter q by 'TransactionType' in ["AccrualReversal", "AdjustedPoints_Negative", "AdjustedPoints_Positive", "RedemptionReversal"];
q = filter q by 'IncludeInManualActions' == "True";
q = group q by 'TransactionType';
q = foreach q generate 'TransactionType' as 'TransactionType', unique('TransactionJournalId') as 'unique_TransactionJournalId';
q = order q by 'TransactionType' asc;
q = limit q 2000;

Transactions_Trend_1.query:
q = load "${App.Datasets.TransactionJournal66.FullyQualifiedName}";
q = filter q by 'Status' == "Processed" && 'JournalType_Name' == "Accrual";
result = group q by ('ActivityDate_Year', 'ActivityDate_Month');
result = foreach result generate q.'ActivityDate_Year' as 'ActivityDate_Year', q.'ActivityDate_Month' as 'ActivityDate_Month', count(q) as 'Count', sum(q.'TransactionAmount') as 'TransactionAmount';
result = fill result by (dateCols=('ActivityDate_Year','ActivityDate_Month', "Y-M"));
result = foreach result generate 'ActivityDate_Year' + "~~~" + 'ActivityDate_Month' as 'ActivityDate_Year~~~ActivityDate_Month', 'Count', 'TransactionAmount';
result = order result by ('ActivityDate_Year~~~ActivityDate_Month' asc);
result = limit result 2000;

Descriptive_KPIs_1.query:
TransactionJournal = load "${App.Datasets.TransactionJournal66.FullyQualifiedName}";
TransactionJournal = filter TransactionJournal by 'JournalType_Name' == "Accrual" && 'Status' == "Processed" && 'LoyaltyProgramMember.ProgramId' == "{{cell(GetMemberDetails_1.result, 0, "LoyaltyProgramMember.ProgramId").asString()}}";
LoyaltyLedger = load "${App.Datasets.LoyaltyLedger66.FullyQualifiedName}";
LoyaltyLedger = filter LoyaltyLedger by 'TransactionJournal.LoyaltyProgramMember.ProgramId' == "{{cell(GetMemberDetails_1.result, 0, "LoyaltyProgramMember.ProgramId").asString()}}";
NQP_redeemption = filter LoyaltyLedger by 'TransactionType' == "Redemption";
LlyMemberCurrency = load "${App.Datasets.LoyaltyMemberCurrency66.FullyQualifiedName}";
LlyMemberCurrency = filter LlyMemberCurrency by 'LoyaltyProgramMember.ProgramId' == "{{cell(GetMemberDetails_1.result, 0, "LoyaltyProgramMember.ProgramId").asString()}}";
result = group TransactionJournal by 'MemberId' full,  LoyaltyLedger by 'LoyaltyProgramMemberId' full, NQP_redeemption by 'LoyaltyProgramMemberId' full, LlyMemberCurrency by 'LoyaltyMemberId';
result = foreach result generate coalesce(TransactionJournal.'MemberId', LoyaltyLedger.'LoyaltyProgramMemberId', NQP_redeemption.'LoyaltyProgramMemberId', LlyMemberCurrency.'LoyaltyMemberId') as 'LoyaltyProgramMemberId', sum(LoyaltyLedger.'Total_Accrued_Points') as 'sum_NQP_Accrued_Points', case when sum(LoyaltyLedger.'Total_Accrued_Points') is not null then rank() over ([..] partition by all order by sum(LoyaltyLedger.'Total_Accrued_Points')) end as 'rank_NQP_Accrued_Points', sum(NQP_redeemption.'Points') as 'sum_NQP_Redeemed_Points', case when sum(NQP_redeemption.'Points') is not null then rank() over ([..] partition by all order by sum(NQP_redeemption.'Points')) end as 'rank_NQP_Redeemed_Points', sum(TransactionJournal.'TransactionAmount') as 'sum_TransactionAmount', case when sum(TransactionJournal.'TransactionAmount') is not null then rank() over ([..] partition by all order by sum(TransactionJournal.'TransactionAmount')) end as 'rank_TransactionAmount', sum(LlyMemberCurrency.'PointsBalance') as 'sum_PointsBalance', case when sum(LlyMemberCurrency.'PointsBalance') is not null then rank() over ([..] partition by all order by sum(LlyMemberCurrency.'PointsBalance')) end as 'rank_PointsBalance';
result = group result by 'LoyaltyProgramMemberId';
result = foreach result generate 'LoyaltyProgramMemberId', first('rank_NQP_Accrued_Points')/ max(first('rank_NQP_Accrued_Points')) over ([..] partition by all) as 'NQP_Accrued_Points_Percentile', first('rank_NQP_Redeemed_Points')/ max(first('rank_NQP_Redeemed_Points')) over ([..] partition by all) as 'NQP_Redeemed_Points_Percentile', first('rank_TransactionAmount')/ max(first('rank_TransactionAmount')) over ([..] partition by all) as 'TransactionAmount_Percentile', first('rank_PointsBalance')/ max(first('rank_PointsBalance')) over ([..] partition by all) as 'PointsBalance_Percentile';
result = filter result by 'LoyaltyProgramMemberId' == "{{cell(GetMemberDetails_1.result, 0, "MemberId").asString()}}";
result = foreach result generate 'LoyaltyProgramMemberId', coalesce('{{coalesce(cell(Static_KPI_1.selection, 0, "Metric"), 0).asString()}}',0) as 'Selected_Percentile', round(coalesce('{{coalesce(cell(Static_KPI_1.selection, 0, "Metric"), 0).asString()}}',0)*100, 0) as 'Selected_Percentile_Rounded', case when '{{coalesce(cell(Static_KPI_1.selection, 0, "Metric"), 0).asString()}}' is not null then "Member is in " else " " end as 'Start_Text', case when '{{coalesce(cell(Static_KPI_1.selection, 0, "Metric"), 0).asString()}}' is not null then "on the basis of" else "                                      " end as 'End_Text', case when '{{coalesce(cell(Static_KPI_1.selection, 0, "Metric"), 0).asString()}}' is not null then +"percentile" else "No Data                         " end as 'Percentile_Text';

MemberRank_1.query:
q = load "${App.Datasets.LoyaltyLedger66.FullyQualifiedName}";
q = group q by all;
q = foreach q generate coalesce({{coalesce(cell(Descriptive_KPIs_1.result, 0, "Selected_Percentile"), 0).asString()}},0) as 'Selected_Percentile';
q = limit q 1;

NQP_ManualActions_Details_1.query:
q = load "${App.Datasets.LoyaltyLedger66.FullyQualifiedName}";
q = filter q by 'IncludeInManualActions' == "True";
q = filter q by 'TransactionType' in ["AccrualReversal", "RedemptionReversal", "AdjustedPoints_Positive", "AdjustedPoints_Negative"] && 'TransactionJournal.ActivityDate_Year' == "{{coalesce(cell(NQP_ManualActions_Trend_1.selection, 0, "TransactionJournal.ActivityDate_Year"), "NA").asString()}}" && 'TransactionJournal.ActivityDate_Month' == "{{coalesce(cell(NQP_ManualActions_Trend_1.selection, 0, "TransactionJournal.ActivityDate_Month"), "NA").asString()}}";
q = foreach q generate 'TransactionType' as 'TransactionType', toDate('TransactionJournal.ActivityDate_sec_epoch') as 'Date', case when 'TransactionType' in ["AccrualReversal", "AdjustedPoints_Negative"] then 'Points'*-1 else 'Points' end as 'Points_with_Sign', 'User.UniqueUserName' as 'User.UniqueUserName', 'ChangeReasonType' as 'ChangeReasonType','AdditionalNotes' as 'AdditionalNotes';
q = order q by 'Date' desc;

NQP_ManualActions_Trend_1.query:
q = load "${App.Datasets.LoyaltyLedger66.FullyQualifiedName}";
q = filter q by 'IncludeInManualActions' == "True";
q = filter q by 'TransactionType' in ["AccrualReversal", "RedemptionReversal", "AdjustedPoints_Positive", "AdjustedPoints_Negative"];
q = group q by ('TransactionJournal.ActivityDate_Year', 'TransactionJournal.ActivityDate_Month', 'TransactionType');
q = foreach q generate 'TransactionJournal.ActivityDate_Year', 'TransactionJournal.ActivityDate_Month', 'TransactionType', case when 'TransactionType' == "AccrualReversal" then sum('Points')*-1 end as 'sum_AccrualReversal', case when 'TransactionType' == "RedemptionReversal" then sum('Points') end as 'sum_RedemptionReversal', case when 'TransactionType' == "AdjustedPoints_Positive" then sum('Points') end as 'sum_AdjustedPointsPositive', case when 'TransactionType' == "AdjustedPoints_Negative" then sum('Points')*-1 end as 'sum_AdjustedPointsNegative';
result = group q by ('TransactionJournal.ActivityDate_Year', 'TransactionJournal.ActivityDate_Month');
result = foreach result generate q.'TransactionJournal.ActivityDate_Year' as 'TransactionJournal.ActivityDate_Year', q.'TransactionJournal.ActivityDate_Month' as 'TransactionJournal.ActivityDate_Month', coalesce(sum(q.'sum_AccrualReversal'),0) as 'NQP_Accrual_Reversal_Points', coalesce(sum(q.'sum_RedemptionReversal'),0) as 'NQP_Redemption_Reversal_Points', coalesce(sum(q.'sum_AdjustedPointsPositive'),0) as 'NQP_Adjusted_Points_Positive', coalesce(sum(q.'sum_AdjustedPointsNegative'),0) as 'NQP_Adjusted_Points_Negative';
result = fill result by (dateCols=('TransactionJournal.ActivityDate_Year','TransactionJournal.ActivityDate_Month', "Y-M"));
result = foreach result generate 'TransactionJournal.ActivityDate_Year' + "~~~" + 'TransactionJournal.ActivityDate_Month' as 'TransactionJournal.ActivityDate_Year~~~TransactionJournal.ActivityDate_Month', 'TransactionJournal.ActivityDate_Year' as 'TransactionJournal.ActivityDate_Year', 'TransactionJournal.ActivityDate_Month' as 'TransactionJournal.ActivityDate_Month', 'NQP_Accrual_Reversal_Points', 'NQP_Redemption_Reversal_Points', 'NQP_Adjusted_Points_Positive', 'NQP_Adjusted_Points_Negative';
result = order result by ('TransactionJournal.ActivityDate_Year~~~TransactionJournal.ActivityDate_Month' asc);
result = limit result 2000;

