q = group q by all;
q = foreach q generate case when {{cell(NQP_ManualActions_Trend_1.selection, 0, "TransactionJournal.ActivityDate_Year").asString()}} is null then "Modifications from Selected Month" else "Modifications in" end as 'Activities_Text';
