TransactionJournal_A_2.query:
q = load "${App.Datasets.LoyaltyLedger66.FullyQualifiedName}";
q_B = filter q by 'TransactionType' == "Redemption";
result = group q by ('TransactionJournal.ActivityDate_Year', 'TransactionJournal.ActivityDate_Month') full, q_B by ('TransactionJournal.ActivityDate_Year', 'TransactionJournal.ActivityDate_Month');
result = foreach result generate coalesce(q.'TransactionJournal.ActivityDate_Year', q_B.'TransactionJournal.ActivityDate_Year') as 'TransactionJournal.ActivityDate_Year', coalesce(q.'TransactionJournal.ActivityDate_Month', q_B.'TransactionJournal.ActivityDate_Month') as 'TransactionJournal.ActivityDate_Month', sum(q_B.'Points') as 'NQP_Redeemed_Points', sum(q.'Total_Accrued_Points') as 'NQP_Accrued_Points';
result = fill result by (dateCols=('TransactionJournal.ActivityDate_Year','TransactionJournal.ActivityDate_Month', "Y-M"));
result = foreach result generate 'TransactionJournal.ActivityDate_Year' + "~~~" + 'TransactionJournal.ActivityDate_Month' as 'TransactionJournal.ActivityDate_Year~~~TransactionJournal.ActivityDate_Month', 'NQP_Redeemed_Points', 'NQP_Accrued_Points';
result = order result by ('TransactionJournal.ActivityDate_Year~~~TransactionJournal.ActivityDate_Month' asc);
result = limit result 2000;
